// CardComponent.tsx
import React from 'react';
import { CardComponentStyled } from "./Dashboard.styles";

interface CardProps {
  id: number;
  imageBuyer: string;
  buyer: string;
  seller: string;
  imageSeller: string;
  tenure: string;
  unitcost: string;
  totalunit: string;
  xirr: string;
  remainingunit: string;
}

const CardComponent: React.FC<CardProps> = ({ id, imageBuyer, buyer, seller, imageSeller, tenure, unitcost, totalunit, xirr, remainingunit }) => {
  return (
    <CardComponentStyled>
      <img src={imageBuyer} alt={buyer} />
      <h3>{buyer}</h3>
      <img src={imageSeller} alt={seller} />
      <p>Seller: {seller}</p>
      <p>Unit Cost: {unitcost}</p>
      <p>Total Unit: {totalunit}</p>
      <p>Remaining Unit: {remainingunit}</p>
      <p>XIRR: {xirr}</p>
      <p>Tenure: {tenure}</p>
    </CardComponentStyled>
  );
};

export default CardComponent;
